<script>
// import { EventBus } from '@/utils/eventBus.js';
import PoppupComponent from '@/components/poppup.vue';
import ModalComponent from '@/components/modal.vue';

export default {
  name: 'MapaComponent',
  data:() => ({
    isPuffed: false,
    indicador1: false,
    indicador2: false,
    indicador3: false,
    indicador4: false,
    indicador5: false,
    indicador6: false,
    indicador7: false,
    indicador8: false,
    elementIdSVG: 'elementIdSVG',
    pathId: "",
    svgWidth: 1500,
    svgHeight: 1500,
    currentView: null,

    series: [60, 90, 20],
    chartOptions: {
      chart: {
        type: 'donut',
      },
      labels: ["disponible", "vendido", "aprartado"],
      colors:['#4eeba2', '#fb5f4f', '#ffc107'],
      responsive: [{
        breakpoint: 280,
        options: {
          chart: {
            width: 200
          },
          legend: {
            position: 'bottom',
          },
        }
      }],
      legend: {
        labels: {
          colors: ['#FFFFFF', '#FFFFFF', '#FFFFFF'] // Esto cambia el color del texto de las etiquetas de la leyenda a blanco
        }
      }
    },
  }),
  components: {
    PoppupComponent,
    ModalComponent
  },
  methods: {
    increaseSize() {
      this.svgWidth += 100;
      this.svgHeight += 100;
    },
    decreaseSize() {
      if (this.svgWidth > 100 && this.svgHeight > 100) {
        this.svgWidth -= 100;
        this.svgHeight -= 100;
      }
    },
    handleClick(pathId) {

      this.isPuffed = !this.isPuffed;
      this.pathId = pathId;

    },
    handleAnimationEnd() {
      if (this.isPuffed) {
        this.currentView = this.pathId;
        this.isPuffed = !this.isPuffed;
        // EventBus.$emit('activate-modal');
        this.$root.$emit('bv::show::modal', 'modal-xl');
      }
    },
    indicated(id){
      this.nonIndicated()
      switch(id){
        case 1:
          this.indicador1 = true;
        break;
        case 2:
          this.indicador2 = true;
        break;
        case 3:
          this.indicador3 = true;
        break;
        case 4:
          this.indicador4 = true;
        break;
        case 5:
          this.indicador5 = true;
        break;
        case 6:
          this.indicador6 = true;
        break;
        case 7:
          this.indicador7 = true;
        break;
        case 8:
          this.indicador8 = true;
        break;
      }
    },
    nonIndicated(){
      this.indicador1 = false;
      this.indicador2 = false;
      this.indicador3 = false;
      this.indicador4 = false;
      this.indicador5 = false;
      this.indicador6 = false;
      this.indicador7 = false;
      this.indicador8 = false;

    }
  },
};
</script>

